import React from 'react';

import '../style/winLoseDraw.css';
import Score from './Score';

const WinLoseDraw = (props) => {

    let score = 'wld';

    const choiceScore = () => {
        console.log('work');
        score = 'win;'
        console.log(score);
    }

    return (
        <div className='wld' onClick={choiceScore}>

            {score}

        </div>
    )
}

export default WinLoseDraw;
